import { RECEIVE_BUSINESSES_ERRORS } from "../../actions/business_actions";

const _nullErrors = [];

const SessionErrorsReducer = (state = _nullErrors, action) => {
  Object.freeze(state);
  switch (action.type) {
    case RECEIVE_BUSINESSES_ERRORS:
      return action.errors;
    default:
      return state;
  }
};

export default SessionErrorsReducer;
